import React from "react";
import axios from "axios";

const callApi = () => {
  return axios
    .get("https://jsonplaceholder.typicode.com/albums")
    .then(function (response) {
      // handle success
      return response.data;
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    });
};

const Api = () => {
  return (
    <div>
      <h1> Get Api</h1>
    </div>
  );
};

export default Api;
